    false,nt"url": null,nt"notes": ""Geothermal Program Fact Sheets.  "In
    May of 1999, the City of Santa Rosa working cooperatively with Unocal, Calpine and
    the State Lands Commission submitted an application for funding from the California
    Energy Commissions Geothermal Program for the City of Santa Rosas Geysers Recharge
    Project. On October 6, 2000 a contract for Project Number GEO-98-001 was executed
    by the California Energy Commission. This contract provided $3,563,000 in CEC funding.
    The project is now near completion and the CEC funding has been expended as anticipated.
    Prior to closing out the contract, Subtasks 5.2.3, - Final Report is required per
    the approved work plan."Energy Commission publication # 500-02-078V1, October 2002.
